Наслідки кератину 😦

 ▪️ доведеться викинути утюжок;
 ▪️ доведеться спати довше, якщо раніше ви щоранку випрямляли волосся;
 ▪️ доведеться перестати купувати нескінченну кількість масок і бальзамів;
 ▪️ доведеться терпіти постійні питання: «а як ти доглядаєш волосся, що воно в тебе таке шикарне?»;
 ▪️ доведеться перестати ходити завжди з хвостиком або гулькою;
 ▪️ доведеться перестати боятися туману, дощу та вологої погоди.

 ❓Що вибираєш ти?

 ❌ продовжувати страждати з неслухняною, кучерявою, плутаною шевелюрою?
 ✅ або насолоджуватися швидким і легким укладанням, блискучим, рівним, шовковистим волоссям?

 Зважилася? Пиши, підберу для тебе ідеальну дату та час 🥰 або переходь по посиланню в шапці і записуйся онлайн самостійно🫶
